import React, { useState, useEffect, useLayoutEffect } from "react";
import axios from "axios";
import styled from "styled-components/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { NavigationContainer } from "@react-navigation/native";
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import { Home, ChatList, Chat } from "./components";
import { Con, HeaderLogo } from "./assets/common/common";
import { photoShopDetail } from "./components/Home/photoShopDetail";
import { photoShopList } from "./components/Home/photoShopList";
import { createStackNavigator } from "@react-navigation/stack";
import Icon from "react-native-vector-icons/MaterialCommunityIcons";

const Tab = createBottomTabNavigator();

export default function App() {
  const [test, setTest] = useState(true);

  return (
    <NavigationContainer>
      <Tab.Navigator
        initialRouteName="Home"
        screenOptions={{
          tabBarStyle: {},
          headerLeft: () => {
            return (
              <HeaderLogo onPress={() => console.log()}>
                우리동네 사진관
              </HeaderLogo>
            );
          },
          headerRight: () => {
            return <Icon name="magnify" size={25} style={{ padding: 15 }} />;
          },
          tabBarShowLabel: false,
          headerTitle: "",
          tabBarInactiveTintColor: "#e0e0e0",
          tabBarActiveTintColor: "#c5e1a5",
        }}
      >
        <Tab.Screen
          name="Home"
          component={Home}
          options={{
            tabBarIcon: (props) => {
              return (
                <Icon
                  name="home-variant-outline"
                  size={35}
                  color={props.color}
                />
              );
            },
          }}
        />
        <Tab.Screen
          name="Chat"
          component={Chat}
          options={{
            tabBarIcon: (props) => {
              return <Icon name="chat-outline" size={35} color={props.color} />;
            },
          }}
        />
        <Tab.Screen
          name="ChatList"
          component={ChatList}
          options={{
            tabBarIcon: (props) => {
              return (
                <Icon name="account-outline" size={35} color={props.color} />
              );
            },
          }}
        />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
